module Mylib.MinFactor (
    minFactor,
    minFactorTbl,
) where

import Data.Array.Unboxed (UArray, listArray, (!))
import Data.Bits (shiftR)
import Data.List (uncons)
import Data.Maybe (fromMaybe)

import qualified Data.Numbers.Primes as P (primes)

minFactor :: Int -> Int
minFactor n
    | n < 1 = error "argument must be a positive number"
    | even n = 2
    | n <= 65535 =
        let tmp = minFactorTbl ! (shiftR n 1)
         in if tmp == 1 then n else tmp
    | otherwise = minFactor' n P.primes

minFactor' :: Int -> [Int] -> Int
minFactor' n plst
    | mod n p == 0 = p
    | otherwise = minFactor' n ps
  where
    (p, ps) = fromMaybe (error "") (uncons plst)

